<p>VB调用C#：需要将C#类库设置为互COM操作,开发环境自动注册，生产环境需要<a href="https://learn.microsoft.com/zh-cn/dotnet/framework/tools/regasm-exe-assembly-registration-tool" target="_blank" rel="noopener noreferrer">regasm</a>生成tlb文件。</p>
